script: |
  super -f text -I q397.spq | sort > q397.out

inputs:
  - name: q397.spq
    data: |
      SELECT + - col2 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE - 85 NOT IN ( - col1, + 83 + - + col0 + - ( + 28 ) );
  - name: tab1

outputs:
  - name: q397.out
    data: |
      -59
      -68
      -96
